rn; // TavernHelper \n  }\n\n  const messages = (window as any).TavernHelper.getChatMessages('0-{{lastMessageId}}');\n  if (!messages || messages.length === 0) return;\n\n  //  AI \n  const latestAI = messages.slice().reverse().find(m => !m.is_user);\n  if (!latestAI) return;\n\n  // \n  const stateBarXml = extractStateBar(latestAI.mes);\n  if (stateBarXml) {\n    const stateBarHtml = convertXmlToHtml(stateBarXml);\n\n    // \n    const container = $('#state-bar-container');\n    container.fadeOut(200, () => {\n      container.html(stateBarHtml);\n      container.fadeIn(200);\n    });\n  }\n}\n\n// ===== 4.  =====\n$(function() {\n  updateStateBar(); // \n\n  // \n  if (typeof eventOn === 'function') {\n    eventOn('MESSAGE_RECEIVED', updateStateBar);\n  }\n});\n\`\`\`\n\n** CSS **\n\n\`\`\`scss\n#state-bar-container {\n  background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);\n  border-radius: 12px;\n  padding: 16px;\n  color: white;\n  box-shadow: 0 4px 15px rgba(0, 0, 0, 0.2);\n  margin-bottom: 16px;\n}\n\n.state-item {\n  padding: 8px 12px;\n  margin: 6px 0;\n  background: rgba(255, 255, 255, 0.1);\n  border-radius: 6px;\n  backdrop-filter: blur(10px);\n  transition: all 0.3s ease;\n\n  &:hover {\n    background: rgba(255, 255, 255, 0.15);\n    transform: translateX(4px);\n  }\n}\n\n// \n.indent-1 { margin-left: 20px; }\n.indent-2 { margin-left: 40px; }\n.indent-3 { margin-left: 60px; }\n\n// \n.state-date, .state-time, .state-location {\n  font-weight: 600;\n  font-size: 14px;\n  padding: 8px 12px;\n  margin: 8px 0;\n  border-radius: 6px;\n}\n\n.state-date { background: rgba(100, 181, 246, 0.2); }\n.state-time { background: rgba(129, 199, 132, 0.2); }\n.state-location { background: rgba(255, 167, 38, 0.2); }\n\n.state-physical {\n  padding: 10px 14px;\n  margin: 8px 0;\n  background: rgba(255, 107, 107, 0.15);\n  border-left: 4px solid #ff6b6b;\n  border-radius: 4px;\n}\n\n.state-mental {\n  padding: 10px 14px;\n  margin: 8px 0;\n  background: rgba(149, 117, 205, 0.15);\n  border-left: 4px solid #9575cd;\n  border-radius: 4px;\n}\n\n.state-colored {\n  padding: 10px 14px;\n  margin: 8px 0;\n  border-radius: 4px;\n  backdrop-filter: blur(5px);\n}\n\n.state-generic {\n  padding: 6px 10px;\n  margin: 4px 0;\n  opacity: 0.9;\n}\n\`\`\`\n\n** GSAP **\n\n\`\`\`typescript\n//  GSAP \nfunction updateStateBarWithAnimation(stateBarHtml: string) {\n  const container = $('#state-bar-container');\n\n  // \n  gsap.to(container, {\n    opacity: 0,\n    y: -10,\n    duration: 0.2,\n    onComplete: () => {\n      container.html(stateBarHtml);\n\n      // \n      gsap.to(container, {\n        opacity: 1,\n        y: 0,\n        duration: 0.3,\n        ease: 'power2.out'\n      });\n\n      // \n      gsap.from('.state-item', {\n        opacity: 0,\n        x: -20,\n        duration: 0.4,\n        stagger: 0.05,\n        ease: 'back.out(1.2)'\n      });\n    }\n  });\n}\n\`\`\`\n****\n1. let/const\n2. function\n3. \`$(function() {})\` - \n4. \`$(window).on('pagehide', ...)\` - \n\n** generation_id **\n****** generation_id **\n-  AI \n- \n- \n\n****\n1. ****index.html + index.ts\n2. \n3.  \`generate(text)\`** generation_id**\n4. **** \`id === currentGenerationId\`\n   - \`iframe_events.STREAM_TOKEN_RECEIVED_INCREMENTALLY\`:  token \n   - \`iframe_events.STREAM_TOKEN_RECEIVED_FULLY\`: \n   - \`iframe_events.GENERATION_ENDED\`: \n5.  \`setChatMessages\`\`createChatMessages\`  \`{ refresh: 'none' }\` \n\n**  API generate()**\n- **\`triggerSlashWithResult(command)\`**:  STScript \n  - \`Promise<string>\`AI \n  - \`const result = await triggerSlashWithResult('/gen lock=on ""');\`\n  - **** \`/gen\` \n  - **** generation_id\n- **\`getRegexScripts()\`**: \n  - \n  - ** AI **\n- **** API \n- **\`triggerSlash(command)\`**:  STScript \n\n** AI **\nAI \`<guide>\`\`<dream>\`\`<plot>\`\`<status>\`\`<think>\` \n****\n\n****\n1. **** AI  \`<gametxt>\`\n2. ****\n3. ****\n\n****\n\`\`\`typescript\n// \nfunction extractLastTagContent(tagName: string, text: string, ignoreCase = false): string | null {\n  if (!text || typeof text !== 'string') return null;\n\n  const endTag = \`</\${tagName}>\`;\n  let searchPool = text;\n  let endTagPattern = endTag;\n\n  if (ignoreCase) {\n    searchPool = text.toLowerCase();\n    endTagPattern = endTag.toLowerCase();\n  }\n\n  const lastEndIndex = searchPool.lastIndexOf(endTagPattern);\n  if (lastEndIndex !== -1) {\n    const startTag = \`<\${tagName}>\`;\n    let startTagPattern = startTag;\n    if (ignoreCase) startTagPattern = startTag.toLowerCase();\n\n    const lastStartIndex = searchPool.lastIndexOf(startTagPattern, lastEndIndex);\n    if (lastStartIndex !== -1) {\n      const startIndex = lastStartIndex + startTag.length;\n      return text.substring(startIndex, lastEndIndex).trim();\n    }\n  }\n  return null;\n}\n\n// \nfunction applyRegexFilters(text: string): string {\n  console.log(' :', text.length);\n\n  if (!text || typeof text !== 'string') return '';\n\n  // =====  0: =====\n  // """"\n  // \n  //  dream  gametxt \n  const criticalTags = ['thinking', 'UpdateVariable', 'guide', 'plot', 'status', 'dream', 'gametxt'];\n  criticalTags.forEach(tag => {\n    const openTagRegex = new RegExp(\`<\${tag}([^>]*)>\`, 'gi');\n    const closeTagRegex = new RegExp(\`</\${tag}>\`, 'gi');\n\n    const openMatches = text.match(openTagRegex);\n    const closeMatches = text.match(closeTagRegex);\n\n    const openCount = openMatches ? openMatches.length : 0;\n    const closeCount = closeMatches ? closeMatches.length : 0;\n\n    if (openCount > closeCount) {\n      // \n      const missing = openCount - closeCount;\n      console.log(\`  \${missing}  <\${tag}> \`);\n      text = text + \`</\${tag}>\`.repeat(missing);\n    }\n  });\n\n  // =====  1: =====\n  //  AI \n  //  dream \n  const gameTextTags = ['dream', 'gametxt', 'output', 'display', 'text', 'content'];\n  for (const tag of gameTextTags) {\n    const extracted = extractLastTagContent(tag, text);\n    if (extracted !== null) {\n      console.log(\`  <\${tag}> :\`, extracted.length);\n      return extracted; // \n    }\n  }\n\n  // =====  2:  -  =====\n  let cleanedText = text;\n\n  // dream/gametxt \n  const tagsToRemove = [\n    'guide', 'plot', 'status',\n    'UpdateVariable', '', '', ''\n  ];\n\n  tagsToRemove.forEach(tag => {\n    //  <tag>...</tag> \n    const regexWithContent = new RegExp(\`<\${tag}[^>]*>[\\\\s\\\\S]*?</\${tag}>\`, 'gi');\n    const before = cleanedText;\n    cleanedText = cleanedText.replace(regexWithContent, '');\n\n    //  <tag/> \n    const regexSelfClosing = new RegExp(\`<\${tag}\\\\s*\\\\/>\`, 'gi');\n    cleanedText = cleanedText.replace(regexSelfClosing, '');\n\n    if (before !== cleanedText) {\n      console.log(\`    <\${tag}> \`);\n    }\n  });\n\n  //   think/thinking \n  //  <xxx_think><thinking_xxx><think><thinking> \n  const thinkingRegex = /<[^>]*think[^>]*>[\\\\s\\\\S]*?<\\/[^>]*think[^>]*>/gi;\n  const beforeThinking = cleanedText;\n  cleanedText = cleanedText.replace(thinkingRegex, '');\n  if (beforeThinking !== cleanedText) {\n    console.log('    think/thinking ');\n  }\n\n  //  think \n  const thinkingSelfClosing = /<[^>]*think[^>]*\\\\/>/gi;\n  cleanedText = cleanedText.replace(thinkingSelfClosing, '');\n\n  //  HTML \n  cleanedText = cleanedText.replace(/\x3c!--[\\s\\S]*?--\x3e/g, '');\n\n  if (cleanedText !== text) {\n    console.log(' :', cleanedText.length);\n    text = cleanedText;\n  }\n\n  // =====  2-3: =====\n  let allRegexScripts: any[] = [];\n\n  //  1: \n  if (typeof getRegexScripts === 'function') {\n    try {\n      const globalRegexes = getRegexScripts();\n      if (globalRegexes && globalRegexes.length > 0) {\n        console.log(' ', globalRegexes.length, '');\n        allRegexScripts = allRegexScripts.concat(globalRegexes);\n      }\n    } catch (e) {\n      console.warn(' :', e);\n    }\n  }\n\n  //  2:  SoliUmbra \n  try {\n    const parentST = (window as any).parent?.SillyTavern || (window as any).SillyTavern;\n    if (parentST && typeof parentST.getContext === 'function') {\n      const context = parentST.getContext();\n      const prompts = context?.chatCompletionSettings?.prompts;\n\n      if (prompts && Array.isArray(prompts)) {\n        const possibleIdentifiers = ['regexes-bindings', 'SPresetSettings', 'regex-bindings'];\n\n        for (const identifier of possibleIdentifiers) {\n          const regexPrompt = prompts.find((p: any) => p.identifier === identifier);\n          if (regexPrompt?.content) {\n            try {\n              const data = JSON.parse(regexPrompt.content);\n              let presetRegexes: any = null;\n\n              if (Array.isArray(data)) {\n                presetRegexes = data;\n              } else if (data && typeof data === 'object') {\n                if (data.RegexBinding?.regexes && Array.isArray(data.RegexBinding.regexes)) {\n                  presetRegexes = data.RegexBinding.regexes;\n                } else if (data.regexes && Array.isArray(data.regexes)) {\n                  presetRegexes = data.regexes;\n                }\n              }\n\n              if (presetRegexes && presetRegexes.length > 0) {\n                console.log(' ', presetRegexes.length, ' (identifier:', identifier + ')');\n                allRegexScripts = allRegexScripts.concat(presetRegexes);\n                break;\n              }\n            } catch (parseError) {\n              console.warn('  identifier', identifier, ':', parseError);\n            }\n          }\n        }\n      }\n    }\n  } catch (e) {\n    console.warn(' :', e);\n  }\n\n  if (allRegexScripts.length > 0) {\n    console.log(' ', allRegexScripts.length, '');\n\n    //  AI placement  2\n    //   disabled  placement promptOnly\n    //  promptOnly \n    const activeScripts = allRegexScripts.filter((script: any) => {\n      if (script.disabled) return false;\n      if (!script.placement || !Array.isArray(script.placement)) return false;\n      if (!script.placement.includes(2)) return false;\n      return true;\n    });\n\n    console.log(' ', activeScripts.length, '');\n\n    let result = text;\n    activeScripts.forEach((script: any, index: number) => {\n      try {\n        const regex = new RegExp(script.findRegex, 'gim');\n        const beforeLength = result.length;\n        result = result.replace(regex, script.replaceString || '');\n\n        if (beforeLength !== result.length) {\n          console.log(' ', index + 1, '(', script.scriptName, ') ');\n        }\n      } catch (e) {\n        console.error(' ', index + 1, ':', e);\n      }\n    });\n\n    text = result;\n  }\n\n  console.log(' :', text.length);\n  return text;\n}\n\`\`\`\n\`\`\`\n\n<\/script>\n\n****\n\`\`\`typescript\n// \nlet chatHistory: Array<{ role: string; content: string }> = [];\nlet isGenerating = false;\n\n// \nasync function handleSend() {\n  const input = $('#user-input');\n  const userInput = input.val().trim();\n  if (!userInput || isGenerating) return;\n\n  // 1. \n  chatHistory.push({ role: 'user', content: userInput });\n  input.val('');\n  renderMessages();\n\n  // 2. \n  isGenerating = true;\n  $('#send-btn').prop('disabled', true).text('...');\n\n  try {\n    // 3. \n    let prompt = '';\n    chatHistory.slice(-10).forEach(msg => {\n      prompt += (msg.role === 'user' ? '' : 'AI') + ': ' + msg.content + '\\n';\n    });\n\n    // 4.  AI\n    const rawResult = await triggerSlashWithResult('/gen lock=on "' + prompt.replace(/"/g, '\\\\"') + '"');\n\n    // 5.  \n    const cleanedResult = applyRegexFilters(rawResult);\n\n    // 6. \n    chatHistory.push({ role: 'assistant', content: cleanedResult });\n    renderMessages();\n    saveChatHistory(); // \n\n  } catch (error) {\n    console.error(':', error);\n    toastr.error(': ' + (error?.message || String(error)));\n  } finally {\n    isGenerating = false;\n    $('#send-btn').prop('disabled', false).text('');\n  }\n}\n\n// \nfunction renderMessages() {\n  const container = $('#messages');\n  container.empty();\n\n  chatHistory.forEach(msg => {\n    const div = $('<div>')\n      .addClass('message')\n      .addClass(msg.role === 'user' ? 'user-message' : 'ai-message')\n      .text(msg.content); //  text()  XSS\n    container.append(div);\n  });\n\n  container.scrollTop(container[0].scrollHeight);\n}\n\n// \nfunction saveChatHistory() {\n  if (typeof insertOrAssignVariables === 'function') {\n    insertOrAssignVariables({ chat_history: chatHistory }, { type: 'chat' });\n  } else {\n    localStorage.setItem('chat_history', JSON.stringify(chatHistory));\n  }\n}\n\`\`\`\n\n** **\n\n** **\n\n###  \n-  \`generate({ should_stream: true, generation_id })\` \n-  \`iframe_events.STREAM_TOKEN_RECEIVED_INCREMENTALLY\` \n- \n-   AI \n-   AI \n\n###  \n-  \`triggerSlashWithResult\`\n-  \n-  \`generateRaw\`\n\n** **\n\n\`\`\`typescript\n// =====  =====\nlet chatHistory: Array<{ role: string; content: string }> = [];\nlet isGenerating = false;\nlet currentGenerationId: string | null = null;\n\n// ===== =====\nfunction setupStreamListeners() {\n  //  \n  eventOn(iframe_events.STREAM_TOKEN_RECEIVED_INCREMENTALLY, (text: string, id: string) => {\n    if (!isGenerating || id !== currentGenerationId) return;\n\n    //  \n    const cleanedText = applyRegexFilters(text);\n\n    //  DOM\n    const container = $('#inner-messages');  //  ID \n    const charName = SillyTavern?.name2 || 'AI';\n    const lastMsg = container.find('.message:last-child');\n\n    if (lastMsg.length && !lastMsg.hasClass('user-message')) {\n      //  AI \n      lastMsg.html('<strong>' + charName + ':</strong> ' + cleanedText);\n    } else {\n      //  AI \n      const msgDiv = $('<div>')\n        .addClass('message ai-message')\n        .html('<strong>' + charName + ':</strong> ' + cleanedText);\n      container.append(msgDiv);\n    }\n\n    // \n    container.scrollTop(container[0].scrollHeight);\n  });\n\n  //  \n  eventOn(iframe_events.GENERATION_ENDED, (text: string, id: string) => {\n    if (id === currentGenerationId) {\n      console.log(' ');\n\n      //  \n      const cleanedText = applyRegexFilters(text);\n\n      // \n      chatHistory.push({ role: 'assistant', content: cleanedText });\n      saveChatHistory();\n\n      // \n      renderMessages();\n\n      // \n      isGenerating = false;\n      currentGenerationId = null;\n      $('#inner-send-btn').prop('disabled', false).text('');  //  ID \n    }\n  });\n}\n\n// ===== =====\nasync function handleSend() {\n  const input = $('#inner-input');  //  ID \n  const userInput = input.val().trim();\n  if (!userInput || isGenerating) return;\n\n  // 1. \n  chatHistory.push({ role: 'user', content: userInput });\n  input.val('');\n  saveChatHistory();\n  renderMessages();\n\n  // 2.  ID\n  currentGenerationId = 'chat-' + Date.now() + '-' + Math.random().toString(36).slice(2);\n\n  // 3. \n  isGenerating = true;\n  $('#inner-send-btn').prop('disabled', true).text('...');  //  ID \n\n  try {\n    // 4.   generate \n    await generate({\n      user_input: userInput,\n      should_stream: true,           //  \n      generation_id: currentGenerationId,  //   ID \n      overrides: {\n        chat_history: {\n          prompts: chatHistory.map(msg => ({\n            role: msg.role === 'user' ? 'user' : 'assistant',\n            content: msg.content\n          }))\n        }\n      }\n    });\n\n    // \n    // GENERATION_ENDED  AI \n\n  } catch (error) {\n    console.error(' :', error);\n    toastr.error(': ' + error.message);\n\n    // \n    isGenerating = false;\n    currentGenerationId = null;\n    $('#inner-send-btn').prop('disabled', false).text('');\n  }\n}\n\n// =====  =====\nfunction renderMessages() {\n  const container = $('#messages');\n  container.empty();\n\n  chatHistory.forEach((msg, index) => {\n    const div = $('<div>')\n      .attr('id', \\\`message-\\\${index}\\\`)  //   id\n      .addClass('message')\n      .addClass(msg.role === 'user' ? 'user-message' : 'ai-message')\n      .text(msg.content);\n    container.append(div);\n  });\n\n  container.scrollTop(container[0].scrollHeight);\n}\n\n// =====  =====\n$(() => {\n  loadChatHistory();\n  setupStreamListeners();  //  \n\n  $('#send-btn').on('click', handleSend);\n  $('#user-input').on('keypress', (e) => {\n    if (e.key === 'Enter' && !e.shiftKey) {\n      e.preventDefault();\n      handleSend();\n    }\n  });\n});\n\\\`\\\`\\\`\n\n** CSS **\n\\\`\\\`\\\`css\n.streaming {\n  border-right: 2px solid #165DFF;\n  animation: blink 1s infinite;\n}\n\n@keyframes blink {\n  0%, 50% { border-right-color: transparent; }\n  51%, 100% { border-right-color: #165DFF; }\n}\n\\\`\\\`\\\`\n\n** **\n- **** 3\n- **** triggerSlashWithResult\n- **** AI \n- **** \n\n** **\n1.   \`generate({ should_stream: true, generation_id: uniqueId })\`\n2.  \`setupStreamListeners()\`\n3.  \`eventOn(iframe_events.STREAM_TOKEN_RECEIVED_INCREMENTALLY, (text, id) => ...)\`\n4.   ID \`generation_id\`\n5.   \`overrides.chat_history.prompts\` \n\n**  \`applyRegexFilters\`**\n1.  **STREAM_TOKEN_RECEIVED_INCREMENTALLY **\n   \`\`\`typescript\n   const cleanedText = applyRegexFilters(text);  // \n   lastMsg.html('<strong>' + charName + ':</strong> ' + cleanedText);\n   \`\`\`\n\n2.  **GENERATION_ENDED **\n   \`\`\`typescript\n   const cleanedText = applyRegexFilters(text);  // \n   chatHistory.push({ role: 'assistant', content: cleanedText });\n   \`\`\`\n\n** \`applyRegexFilters\` **\n1.  ****""""\n2.  **** \`<dream>\`\`<gametxt>\` \n3.  **** \`think\` \n4.  ****\n\n** **\n- ****\`<dream>\`\`<gametxt>\`\`<output>\` \n- ****\`['dream', 'gametxt', 'output', 'display', 'text', 'content']\`\n- ****\n- ****\n  \`\`\`\n  <guide></guide><dream></dream><plot></plot>\n      <dream> \n  \`\`\`\n\n** **\n-  \`think\`  \`thinking\`\n- \`/<[^>]*think[^>]*>[\\s\\S]*?<\\/[^>]*think[^>]*>/gi\`\n- \`<think>\`\`<thinking>\`\`<xxx_think>\`\`<thinking_xxx>\` \n- \n\n****\n-    \`<thinking>\`    + \n-    \`<UpdateVariable>\`    + \n-     \`<UpdateVariable>\`   \`<UpdateVariable>\` \n\n** **\n-  / text \`applyRegexFilters\`\n-   text\n-   text\n-   \`should_stream: true\`\n-   \`generation_id\`\n-   ID\n-  \n\n** **\n**** \`$(function() {})\` \n\n\`\`\`javascript\n//  \n$(function() {\n  let chatHistory = [];  //  \n  function renderMessages() {}  //  \n});\n\n//  \nlet chatHistory = [];  //  \nfunction renderMessages() {}  //  \n\n$(function() {\n  // \n  loadChatHistory();\n});\n\`\`\`\n\n** **\n\n\`\`\`javascript\n// index.ts \n//\n// 1  1-10 \n//    let chatHistory = [];\n//    let isGenerating = false;\n//    ...\n//\n// 2  10-250 \n//    function loadChatHistory() { ... }\n//    function saveChatHistory() { ... }\n//    function renderMessages() { ... }\n//    function applyRegexFilters(text) { ... }  //  \n//    function handleSend() { ... }\n//\n// 3 jQuery  250-270 \n//    $(function() {\n//      // \n//      loadChatHistory();\n//      $('#btn').on('click', handleSend);\n//    });\n//\n// 4  270-275 \n//    $(window).on('pagehide', () => { ... });\n\`\`\`\n\n** 100% **\n\n\`\`\`javascript\n// =====================================================\n//   $(function() {}) \n// =====================================================\n\n// ===== 1. =====\nlet chatHistory = []; // { role: 'user'|'assistant', content: string }\nlet isGenerating = false;\n\n// ===== 2.  =====\nfunction loadChatHistory() {\n  const isInTavern = typeof getVariables === 'function';\n  if (!isInTavern) {\n    // \n    const saved = localStorage.getItem('inner_chat_history');\n    chatHistory = saved ? JSON.parse(saved) : [];\n  } else {\n    // \n    const data = getVariables({ type: 'chat' });\n    chatHistory = data?.inner_chat_history || [];\n  }\n  renderMessages();\n}\n\nfunction saveChatHistory() {\n  const isInTavern = typeof insertOrAssignVariables === 'function';\n  if (!isInTavern) {\n    localStorage.setItem('inner_chat_history', JSON.stringify(chatHistory));\n  } else {\n    insertOrAssignVariables({ inner_chat_history: chatHistory }, { type: 'chat' });\n  }\n}\n\n// ===== 3.  =====\nfunction renderMessages() {\n  console.log(' renderMessages :', chatHistory.length, '');\n\n  const container = $('#inner-messages');\n  console.log(' :', container.length > 0 ? ' ' : ' ');\n\n  container.empty();\n\n  chatHistory.forEach((msg, index) => {\n    // \n    const name = msg.role === 'user'\n      ? (typeof getCurrentUser === 'function' ? getCurrentUser()?.name : null) || '{{user}}'\n      : (typeof getCurrentCharacter === 'function' ? getCurrentCharacter()?.name : null) || '{{char}}';\n\n    console.log(' ', index + 1, ':', msg.role, '-', name, '- :', msg.content.length);\n\n    const msgDiv = $('<div>')\n      .addClass('message')\n      .addClass(msg.role === 'user' ? 'user-message' : 'ai-message')\n      .html('<strong>' + name + ':</strong> ' + msg.content);\n    container.append(msgDiv);\n  });\n\n  console.log(' renderMessages :', container.find('.message').length);\n\n  // \n  container.scrollTop(container[0].scrollHeight);\n}\n// ===== 4.  =====\n/**\n *  AI \n * \n * 1.  getRegexScripts\n * 2.  SoliUmbra \n * 3. \n */\nfunction applyRegexFilters(text) {\n  console.log(' :', text.length);\n\n  // =====  0: =====\n  // <guide><dream><plot><status><think> \n  let cleanedText = text;\n  const commonTags = [\n    'guide', 'dream', 'plot', 'status', 'think', 'thinking',\n    'thought', 'reasoning', 'analysis', 'plan', 'reflection',\n    'meta', 'ooc', 'system', 'debug'\n  ];\n\n  commonTags.forEach(tag => {\n    //  <tag>...</tag> \n    const regex = new RegExp(\`<\${tag}[^>]*>[\\\\s\\\\S]*?</\${tag}>\`, 'gi');\n    const before = cleanedText;\n    cleanedText = cleanedText.replace(regex, '');\n    if (before !== cleanedText) {\n      console.log(\`   :  <\${tag}> \`);\n    }\n  });\n\n  //  HTML \n  cleanedText = cleanedText.replace(/\x3c!--[\\s\\S]*?--\x3e/g, '');\n\n  // \n  if (cleanedText !== text) {\n    console.log(' :', cleanedText.length);\n    text = cleanedText;\n  }\n\n  // =====  1-2:  =====\n  let allRegexScripts = [];\n\n  //  1: \n  if (typeof getRegexScripts === 'function') {\n    try {\n      const globalRegex = getRegexScripts();\n      console.log(' ', globalRegex.length, '');\n      allRegexScripts = allRegexScripts.concat(globalRegex);\n    } catch (e) {\n      console.warn(' :', e);\n    }\n  }\n\n  //  2: SoliUmbra \n  //   iframe  window.parent.SillyTavern.getContext() \n  try {\n    const parentST = window.parent?.SillyTavern || window.SillyTavern;\n    if (parentST && typeof parentST.getContext === 'function') {\n      const context = parentST.getContext();\n      const prompts = context?.chatCompletionSettings?.prompts;\n\n      if (prompts && Array.isArray(prompts)) {\n        //  identifier\n        const possibleIdentifiers = ['regexes-bindings', 'SPresetSettings', 'regex-bindings'];\n\n        for (const identifier of possibleIdentifiers) {\n          const regexPrompt = prompts.find(p => p.identifier === identifier);\n          if (regexPrompt?.content) {\n            try {\n              const data = JSON.parse(regexPrompt.content);\n              let presetRegexes = null;\n\n              // \n              if (Array.isArray(data)) {\n                //  regexes-bindings\n                presetRegexes = data;\n              } else if (data && typeof data === 'object') {\n                //  SPresetSettings.RegexBinding.regexes\n                if (data.RegexBinding?.regexes && Array.isArray(data.RegexBinding.regexes)) {\n                  presetRegexes = data.RegexBinding.regexes;\n                } else if (data.regexes && Array.isArray(data.regexes)) {\n                  presetRegexes = data.regexes;\n                }\n              }\n\n              if (presetRegexes && presetRegexes.length > 0) {\n                console.log(' ', presetRegexes.length, ' (identifier:', identifier + ')');\n                allRegexScripts = allRegexScripts.concat(presetRegexes);\n                break; // \n              }\n            } catch (parseError) {\n              console.warn('  identifier', identifier, ':', parseError);\n            }\n          }\n        }\n      }\n    }\n  } catch (e) {\n    console.warn(' :', e);\n  }\n\n  if (allRegexScripts.length === 0) {\n    console.log(' ');\n    return text;\n  }\n\n  console.log(' ', allRegexScripts.length, '');\n\n  //  AI \n  // placement :\n  //   0 = \n  //   1 =  AI \n  //   2 = AI  \n  // promptOnly: true = \n  // promptOnly: false =   \n  const activeScripts = allRegexScripts.filter(script => {\n    return !script.disabled &&\n           !script.promptOnly &&  //  promptOnly  false \n           script.placement &&\n           script.placement.includes(2);  //  placement  2 AI \n  });\n\n  console.log(' ', activeScripts.length, '');\n\n  let result = text;\n\n  // \n  activeScripts.forEach((script, index) => {\n    try {\n      const regex = new RegExp(script.findRegex, 'gim');\n      const beforeLength = result.length;\n      result = result.replace(regex, script.replaceString || '');\n\n      if (beforeLength !== result.length) {\n        console.log(' ', index + 1, '(', script.scriptName, ') ', beforeLength - result.length, '');\n      }\n    } catch (e) {\n      console.error(' ', index + 1, '(', script.scriptName, ') :', e);\n    }\n  });\n\n  console.log(' :', text.length, ':', result.length);\n\n  return result;\n}\n\n// ===== 5.  =====\n//   sendChatMessage\n//  \nasync function handleSend() {\n  const input = $('#inner-user-input');\n  const text = input.val().trim();\n\n  if (!text || isGenerating) return;\n\n  // \n  chatHistory.push({ role: 'user', content: text });\n  input.val('');\n  renderMessages();\n  saveChatHistory();\n\n  // \n  isGenerating = true;\n  $('#inner-send-btn').prop('disabled', true).text('...');\n\n  try {\n    //   STScript API \n    if (typeof triggerSlashWithResult !== 'function') {\n      throw new Error('');\n    }\n\n    // \n    const userName = SillyTavern?.name1 || 'You';\n    const charName = SillyTavern?.name2 || 'AI';\n\n    // \n    let fullPrompt = '';\n    if (chatHistory.length > 0) {\n      fullPrompt += '\\n';\n      chatHistory.forEach((msg) => {\n        const name = msg.role === 'user' ? userName : charName;\n        fullPrompt += name + ': ' + msg.content + '\\n';\n      });\n      fullPrompt += '\\n';\n    }\n    fullPrompt += userName + ': ' + text;\n\n    console.log(' :', fullPrompt.length);\n\n    //   /gen \n    const command = '/gen lock=on "' + fullPrompt.replace(/"/g, '\\\\"') + '"';\n    const result = await triggerSlashWithResult(command);\n\n    console.log(' AI :', result ? result.length : 0);\n\n    if (result && result.length > 0) {\n      //  \n      const cleanedResult = applyRegexFilters(result);\n      console.log(' :', cleanedResult.length);\n\n      //  AI \n      chatHistory.push({ role: 'assistant', content: cleanedResult });\n      saveChatHistory();\n      renderMessages();\n      toastr.success('');\n    } else {\n      toastr.warning('AI ');\n    }\n\n  } catch (error) {\n    console.error(':', error);\n    toastr.error(': ' + (error?.message || String(error)));\n  } finally {\n    // \n    isGenerating = false;\n    $('#inner-send-btn').prop('disabled', false).text('');\n  }\n}\n\n// =====================================================\n//   $(function() {})\n// =====================================================\n\n// ===== 6.  =====\n//  \n$(function() {\n  // \n  console.log(' ');\n  console.log(' chatHistory :', typeof chatHistory !== 'undefined');\n  console.log(' renderMessages :', typeof renderMessages === 'function');\n  console.log(' handleSend :', typeof handleSend === 'function');\n\n  //   false $(function() {}) \n  if (typeof chatHistory === 'undefined' || typeof renderMessages !== 'function') {\n    console.error(' /');\n    console.error(' $(function() {}) ');\n    toastr.error('');\n    return;\n  }\n\n  loadChatHistory();\n\n  // \n  $('#inner-send-btn').on('click', handleSend);\n  $('#inner-user-input').on('keypress', (e) => {\n    if (e.key === 'Enter' && !e.shiftKey) {\n      e.preventDefault();\n      handleSend();\n    }\n  });\n\n  // \n  $('#inner-clear-btn').on('click', () => {\n    if (confirm('')) {\n      chatHistory = [];\n      renderMessages();\n      saveChatHistory();\n    }\n  });\n\n  console.log(' ');\n  console.log(' :', $('#inner-messages').length > 0 ? ' ' : ' ');\n});\n\n// ===== 7.  =====\n$(window).on('pagehide', () => {\n  saveChatHistory();\n});\n\`\`\`\n\n**HTML **\n\`\`\`html\n<div class="inner-chat-container">\n  <div class="inner-chat-header">\n    <h3></h3>\n    <button id="inner-clear-btn"></button>\n  </div>\n\n  \x3c!--  ID  inner-messages --\x3e\n  <div id="inner-messages" class="inner-messages"></div>\n\n  <div class="inner-input-area">\n    \x3c!--  ID  inner-user-input --\x3e\n    <textarea id="inner-user-input" placeholder="..."></textarea>\n    \x3c!--  ID  inner-send-btn --\x3e\n    <button id="inner-send-btn"></button>\n  </div>\n</div>\n\`\`\`\n\n** HTML **\n- [ ]  \`id="inner-messages"\` \n- [ ]  \`id="inner-user-input"\` \n- [ ]  \`id="inner-send-btn"\` \n- [ ]  \`id="inner-clear-btn"\` \n- [ ] ID  JS \n\n**CSS **\n\`\`\`css\n/*  */\n.inner-messages {\n  height: 400px;\n  overflow-y: auto;\n  padding: 15px;\n  display: flex;  /*   flex */\n  flex-direction: column;\n  gap: 10px;\n}\n\n/*  */\n.message {\n  max-width: 70%;\n  padding: 10px 15px;\n  border-radius: 12px;\n  word-wrap: break-word;\n}\n\n/*   */\n.user-message {\n  align-self: flex-end;  /*  */\n  background: #4a9eff;\n  color: white;\n}\n\n/*  AI  */\n.ai-message {\n  align-self: flex-start;  /*  */\n  background: #2a2a2a;\n  color: #e0e0e0;\n}\n\`\`\`\n\n** **\n- ID \`inner-\`\n-  \`display: flex; flex-direction: column\`\n-  \`align-self: flex-end\` \n- AI  \`align-self: flex-start\` \n\n** API**\n- **\`generate(prompt)\`**: ** AI **\n- \`generateRaw(prompt)\`:  AI \n- \`getVariables({ type: 'message', message_id })\`: \n- \`insertOrAssignVariables(data, { type: 'message', message_id })\`: \n- \`getChatMessages()\`: \n\n****\n- **\`generate\`**: \n- **\`generateRaw\`**: \n\n** **\n1. **80% **\n   -  **** \`$(function() {})\`  \`let\`/\`const\`/\`function\` \n   -  ********\`$(function() {})\` \n   - **** \`console.log(typeof chatHistory)\` \`'object'\`  \`'undefined'\`\n\n1.5. **/**\n   -  ****\`chatHistory.push({ role: 'assistant', content: '' });\`\n   -  ****\`chatHistory.push({ role: 'assistant', content: ' AI ' });\`\n   -  **** AI \n   -  **** \`generate()\`AI  \`STREAM_TOKEN_RECEIVED_FULLY\` \n   - ****\`generate()\`  AI API\n\n2. **generation_id **\n   -  \`const result = await generate(...); const id = result.generation_id;\`\n   -  \n     \`\`\`javascript\n     const myId = 'chat-' + Date.now() + '-' + Math.random().toString(36).slice(2);\n     await generate({ user_input: text, generation_id: myId });\n     //  id  myId\n     \`\`\`\n   - \`generate()\`  \`Promise<string>\`\n   -  ID \n\n3. ****\n   -  \`index.html\` + \`index.ts\`\n   - \n   -  \`setChatMessages(..., { refresh: 'none' })\` \n4. ****\n   -   \`sendChatMessage\`\n   -   \`generate\`\`getChatMessages\`  API \n   -  \`handleSend\`\`innerSendMessage\`\`sendInnerMessage\`\n   - **** \`sk()\` \n\n5. ** ID **\n   -  \`inner-\` \n   -  \`send-button\`\`user-input\` \n   - **** \`$('#inner-messages').length\`  1 0\n\n6. ****\n   -  ** \`iframe_events.XXX\` \`'iframe_events.XXX'\`**\n   -  ** \`(text, id)\` \`(data)\` \`text\`  \`data.text\`**\n   -  **\`generate({ user_input: text, should_stream: true, generation_id: myId })\`**\n   -  \`eventOn(iframe_events.STREAM_TOKEN_RECEIVED_FULLY, (text, id) => ...)\` \n   -  \`eventOn(iframe_events.STREAM_TOKEN_RECEIVED_INCREMENTALLY, (text, id) => ...)\` \n\n7. **API **\n   -  \`generate(prompt)\`\n   -  \`generateRaw(prompt)\`\n   - \n\n8. ****\n   -  \`getVariables({ type: 'chat' })\`  \`insertOrAssignVariables(data, { type: 'chat' })\`\n   - \`{ type: 'message', message_id }\`\n   - \n\n****\n\`\`\`javascript\n// ==========  ==========\n\n//  \n// eventOn('iframe_events.STREAM_TOKEN_RECEIVED_FULLY', (data) => { ... })\n//   'iframe_events.XXX'\n//   (data)\n\n//  \neventOn(iframe_events.STREAM_TOKEN_RECEIVED_INCREMENTALLY, (text, id) => {\n  // text \n  $('#ai-reply').text(text); //   text text.text  data.text\n  console.log(':', text);\n});\n\neventOn(iframe_events.STREAM_TOKEN_RECEIVED_FULLY, (text, id) => {\n  // text \n  console.log(' :', text); //   text\n  chatHistory.push({ role: 'assistant', content: text });\n  saveChatHistory();\n  isGenerating = false;\n  $('#send-btn').prop('disabled', false).text('');\n});\n\n//  GENERATION_ENDED\neventOn(iframe_events.GENERATION_ENDED, (text, id) => {\n  console.log(' :', text);\n  chatHistory.push({ role: 'assistant', content: text });\n  saveChatHistory();\n  isGenerating = false;\n  $('#send-btn').prop('disabled', false).text('');\n});\n\n// ==========  ==========\nasync function handleSend() {\n  const userInput = $('#user-input').val();\n  chatHistory.push({ role: 'user', content: userInput });\n\n  isGenerating = true;\n  $('#send-btn').prop('disabled', true).text('...');\n\n  //   STScript \n  const command = '/gen lock=on "' + userInput.replace(/"/g, '\\\\"') + '"';\n  const result = await triggerSlashWithResult(command);\n\n  if (result) {\n    chatHistory.push({ role: 'assistant', content: result });\n    renderMessages();\n  }\n\n  //   generate API\n  // await generate({ user_input: userInput });  //  \n}\n\`\`\`\n\n** triggerSlashWithResult**\n-  \`/gen\` \n- \n-  generation_id \n\n**\`/gen\` **\n- \`/gen lock=on ""\`\n- \n-  AI \n\n---\n\n#  AI \n\n**""""""""******B\n****A\n\n##  \n\n### 1. \n-  **** \`insertOrAssignVariables({ inner_chat_history: chatHistory }, { type: 'chat' })\`\n-  **** \`$(function() {})\`  \`loadChatHistory()\`\n-  **** \`SillyTavern.getCurrentChatId()\` \n-  **** \`$(window).on('pagehide', ...)\` \n-  ****/ \`saveChatHistory()\`\n\n### 2. \n-  ****\`display: none\`iframe \n-  ****\n-  **** \`chatHistory\`\n\n### 3. \n-  **** \`{ type: 'chat' }\`\n-  **** \`getCurrentChatId()\` \n\n##  triggerSlashWithResult\n\n**** \n\n****\n\n\`\`\`typescript\n// ===== 1. =====\nlet chatHistory: Array<{ role: string; content: string }> = [];\nlet isGenerating = false;\n\n// ===== 2.  =====\nfunction loadChatHistory() {\n  const isInTavern = typeof getVariables === 'function';\n  if (!isInTavern) {\n    const saved = localStorage.getItem('inner_chat_history');\n    chatHistory = saved ? JSON.parse(saved) : [];\n  } else {\n    const data = getVariables({ type: 'chat' });\n    chatHistory = data?.inner_chat_history || [];\n  }\n  renderMessages();\n}\n\nfunction saveChatHistory() {\n  const isInTavern = typeof insertOrAssignVariables === 'function';\n  if (!isInTavern) {\n    localStorage.setItem('inner_chat_history', JSON.stringify(chatHistory));\n  } else {\n    insertOrAssignVariables({ inner_chat_history: chatHistory }, { type: 'chat' });\n  }\n}\n\n// ===== 3. =====\nfunction applyRegexFilters(text: string): string {\n  console.log(' :', text.length);\n\n  if (!text || typeof text !== 'string') return '';\n\n  // =====  0:  =====\n  const criticalTags = ['thinking', 'UpdateVariable', 'guide', 'plot', 'status', 'dream', 'gametxt'];\n  criticalTags.forEach(tag => {\n    const openTagRegex = new RegExp(\\\`<\\\${tag}([^>]*)>\\\`, 'gi');\n    const closeTagRegex = new RegExp(\\\`</\\\${tag}>\\\`, 'gi');\n\n    const openMatches = text.match(openTagRegex);\n    const closeMatches = text.match(closeTagRegex);\n\n    const openCount = openMatches ? openMatches.length : 0;\n    const closeCount = closeMatches ? closeMatches.length : 0;\n\n    if (openCount > closeCount) {\n      const missing = openCount - closeCount;\n      console.log(\\\`  \\\${missing}  <\\\${tag}> \\\`);\n      text = text + \\\`</\\\${tag}>\\\`.repeat(missing);\n    }\n  });\n\n  // =====  1: =====\n  function extractLastTagContent(tagName: string, text: string): string | null {\n    if (!text || typeof text !== 'string') return null;\n\n    const endTag = \\\`</\\\${tagName}>\\\`;\n    const searchPool = text.toLowerCase();\n    const endTagPattern = endTag.toLowerCase();\n\n    const lastEndIndex = searchPool.lastIndexOf(endTagPattern);\n    if (lastEndIndex !== -1) {\n      const startTag = \\\`<\\\${tagName}>\\\`;\n      const startTagPattern = startTag.toLowerCase();\n\n      const lastStartIndex = searchPool.lastIndexOf(startTagPattern, lastEndIndex);\n      if (lastStartIndex !== -1) {\n        const startIndex = lastStartIndex + startTag.length;\n        return text.substring(startIndex, lastEndIndex).trim();\n      }\n    }\n    return null;\n  }\n\n  const gameTextTags = ['dream', 'gametxt', 'output', 'display', 'text', 'content'];\n  for (const tag of gameTextTags) {\n    const extracted = extractLastTagContent(tag, text);\n    if (extracted !== null) {\n      console.log(\\\`  <\\\${tag}> :\\\`, extracted.length);\n      return extracted;\n    }\n  }\n\n  // =====  2:  =====\n  let cleanedText = text;\n\n  const tagsToRemove = [\n    'guide', 'plot', 'status',\n    'UpdateVariable', '', '', ''\n  ];\n\n  tagsToRemove.forEach(tag => {\n    const regexWithContent = new RegExp(\\\`<\\\${tag}[^>]*>[\\\\\\\\s\\\\\\\\S]*?</\\\${tag}>\\\`, 'gi');\n    const before = cleanedText;\n    cleanedText = cleanedText.replace(regexWithContent, '');\n\n    const regexSelfClosing = new RegExp(\\\`<\\\${tag}\\\\\\\\s*\\\\\\\\/>\\\`, 'gi');\n    cleanedText = cleanedText.replace(regexSelfClosing, '');\n\n    if (before !== cleanedText) {\n      console.log(\\\`    <\\\${tag}> \\\`);\n    }\n  });\n\n  //  think/thinking \n  const thinkingRegex = /<[^>]*think[^>]*>[\\\\s\\\\S]*?<\\\\/[^>]*think[^>]*>/gi;\n  const beforeThinking = cleanedText;\n  cleanedText = cleanedText.replace(thinkingRegex, '');\n  if (beforeThinking !== cleanedText) {\n    console.log('    think/thinking ');\n  }\n\n  const thinkingSelfClosing = /<[^>]*think[^>]*\\\\/>/gi;\n  cleanedText = cleanedText.replace(thinkingSelfClosing, '');\n\n  cleanedText = cleanedText.replace(/\x3c!--[\\s\\S]*?--\x3e/g, '');\n\n  if (cleanedText !== text) {\n    console.log(' :', cleanedText.length);\n    text = cleanedText;\n  }\n\n  // =====  3: =====\n  let allRegexScripts: any[] = [];\n\n  if (typeof getRegexScripts === 'function') {\n    try {\n      const globalRegexes = getRegexScripts();\n      if (globalRegexes && globalRegexes.length > 0) {\n        console.log(' ', globalRegexes.length, '');\n        allRegexScripts = allRegexScripts.concat(globalRegexes);\n      }\n    } catch (e) {\n      console.warn(' :', e);\n    }\n  }\n\n  try {\n    const parentST = (window as any).parent?.SillyTavern || (window as any).SillyTavern;\n    if (parentST && typeof parentST.getContext === 'function') {\n      const context = parentST.getContext();\n      const prompts = context?.chatCompletionSettings?.prompts;\n\n      if (prompts && Array.isArray(prompts)) {\n        const possibleIdentifiers = ['regexes-bindings', 'SPresetSettings', 'regex-bindings'];\n\n        for (const identifier of possibleIdentifiers) {\n          const regexPrompt = prompts.find((p: any) => p.identifier === identifier);\n          if (regexPrompt?.content) {\n            try {\n              const data = JSON.parse(regexPrompt.content);\n              let presetRegexes: any = null;\n\n              if (Array.isArray(data)) {\n                presetRegexes = data;\n              } else if (data && typeof data === 'object') {\n                if (data.RegexBinding?.regexes && Array.isArray(data.RegexBinding.regexes)) {\n                  presetRegexes = data.RegexBinding.regexes;\n                } else if (data.regexes && Array.isArray(data.regexes)) {\n                  presetRegexes = data.regexes;\n                }\n              }\n\n              if (presetRegexes && presetRegexes.length > 0) {\n                console.log(' ', presetRegexes.length, ' (identifier:', identifier + ')');\n                allRegexScripts = allRegexScripts.concat(presetRegexes);\n                break;\n              }\n            } catch (parseError) {\n              console.warn('  identifier', identifier, ':', parseError);\n            }\n          }\n        }\n      }\n    }\n  } catch (e) {\n    console.warn(' :', e);\n  }\n\n  if (allRegexScripts.length > 0) {\n    console.log(' ', allRegexScripts.length, '');\n\n    const activeScripts = allRegexScripts.filter((script: any) => {\n      if (script.disabled) return false;\n      if (!script.placement || !Array.isArray(script.placement)) return false;\n      if (!script.placement.includes(2)) return false;\n      return true;\n    });\n\n    console.log(' ', activeScripts.length, '');\n\n    let result = text;\n    activeScripts.forEach((script: any, index: number) => {\n      try {\n        const regex = new RegExp(script.findRegex, 'gim');\n        const beforeLength = result.length;\n        result = result.replace(regex, script.replaceString || '');\n\n        if (beforeLength !== result.length) {\n          console.log(' ', index + 1, '(', script.scriptName, ') ');\n        }\n      } catch (e) {\n        console.error(' ', index + 1, ':', e);\n      }\n    });\n\n    text = result;\n  }\n\n  console.log(' :', text.length);\n  return text;\n}\n\n// ===== 4.  =====\nasync function handleSend() {\n  const input = $('#inner-input');\n  const userInput = input.val().trim();\n  if (!userInput || isGenerating) return;\n\n  chatHistory.push({ role: 'user', content: userInput });\n  input.val('');\n  saveChatHistory();\n  renderMessages();\n\n  isGenerating = true;\n  $('#inner-send-btn').prop('disabled', true).text('...');\n\n  try {\n    if (typeof triggerSlashWithResult !== 'function') {\n      throw new Error('');\n    }\n\n    const userName = SillyTavern?.name1 || 'You';\n    const charName = SillyTavern?.name2 || 'AI';\n\n    let fullPrompt = '';\n    if (chatHistory.length > 1) {\n      fullPrompt += '\\n';\n      chatHistory.slice(0, -1)